import { Link, NavLink, useParams } from "react-router-dom";

function EventPage() {
    const params = useParams();
    const DUMMY_EVENTS = [
        {
            id:'e1',
            name:'Event one',
            description:'Hey this is event one'
        },
        {
            id:'e2',
            name:'Event two',
            description:'Hey this is event two'
        },
        {
            id:'e3',
            name:'Event three',
            description:'Hey this is event three'
        }
    ];
    return(
        <>
            <h1>Hey, this is the event page !!</h1>
            <ul>
                {
                    DUMMY_EVENTS.map((event) => (
                        <li key={event.id}><Link to = {`/events/${event.id}`}>{event.title}</Link></li>
                    ))
                }
            </ul>
        </>
    )
}
export default EventPage;
